import React, { useRef, useState } from 'react';
import PropTypes from 'prop-types';
import { Avatar } from 'antd';

import Text from '../../Typography/Text';
import Card from '../../Card/Card';
import {truncateText} from '../../../../utils/helper';
import './Testimonies.css';
const HomepageTestimonies = ({ isMobile,isTablet }) => {
  // Array of testimonies (just as an example)
  const testimonies = [
    {
      name: "John Doe",
      userimage:<svg width="200" height="200" viewBox="0 0 200 200" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
          <rect width="200" height="200" rx="100" fill="url(#pattern0_3009_3742)"/>
          <defs>
          <pattern id="pattern0_3009_3742" patternContentUnits="objectBoundingBox" width="1" height="1">
          <use xlinkHref="#image0_3009_3742" transform="scale(0.000976562)"/>
          </pattern>
          <image id="image0_3009_3742" width="1024" height="1024" xlinkHref="data:image/jpeg;base64,"/>
          </defs>
          </svg>
    ,      
      title: "Founder of ABC Corp.",
      text: "OAHSE has been a game changer in how I source and manage resources. Highly recommend!"
    },
    {
      name: "Mayank Balakrishnan",
      title: "Founder of Fetherstill Inc.",
      text: "I have been having difficulty sourcing materials which I work with, and even if I do get it, I spend a lot until I came across this platform, OAHSE!"
    },
    {
      name: "John Doe",
      title: "Founder of ABC Corp.",
      text: "OAHSE has been a game changer in how I source and manage resources. Highly recommend!"
    },
    // Add more testimonies as needed
  ];

  // State for the current testimony
  const [currentTestimonyIndex, setCurrentTestimonyIndex] = useState(0);

  // Function to navigate to the next testimony
  const nextTestimony = () => {
    if (currentTestimonyIndex < testimonies.length - 1) {
      setCurrentTestimonyIndex(currentTestimonyIndex + 1);
    }
  };

  // Function to navigate to the previous testimony
  const prevTestimony = () => {
    if (currentTestimonyIndex > 0) {
      setCurrentTestimonyIndex(currentTestimonyIndex - 1);
    }
  };

  const currentTestimony = testimonies[currentTestimonyIndex];
  document.addEventListener('DOMContentLoaded', () => {
    const container = document.querySelector('.scrollable-homepage-testimonies-container');
  
    let isDragging = false;
    let startX, scrollLeft;
  
    container.addEventListener('mousedown', (e) => {
      isDragging = true;
      container.classList.add('active'); // Optional: Add a class for active drag styling
      startX = e.pageX - container.offsetLeft;
      scrollLeft = container.scrollLeft;
    });
  
    container.addEventListener('mouseleave', () => {
      isDragging = false;
      container.classList.remove('active');
    });
  
    container.addEventListener('mouseup', () => {
      isDragging = false;
      container.classList.remove('active');
    });
  
    container.addEventListener('mousemove', (e) => {
      if (!isDragging) return; // Exit if not dragging
      e.preventDefault();
      const x = e.pageX - container.offsetLeft;
      const walk = (x - startX) * 2; // Adjust scrolling speed by multiplying
      container.scrollLeft = scrollLeft - walk;
    });
  });
  const scrollContainerRef = useRef(null);
    const [isDragging, setIsDragging] = useState(false);
    const [startX, setStartX] = useState(0);
    const [scrollLeft, setScrollLeft] = useState(0);
  
    const handleMouseDown = (e) => {
      setIsDragging(true);
      setStartX(e.clientX);
      setScrollLeft(scrollContainerRef.current.scrollLeft);
      scrollContainerRef.current.style.cursor = 'grabbing'; // Change cursor on drag start
    };
  
    const handleMouseMove = (e) => {
      if (!isDragging) return;
    
      const deltaX = e.clientX - startX;
    
      scrollContainerRef.current.scrollLeft = scrollLeft - deltaX;
    };
    
  
    const handleMouseUp = () => {
      setIsDragging(false);
      scrollContainerRef.current.style.cursor = 'grab'; // Reset cursor when dragging stops
    };
  
    const handleMouseLeave = () => {
      if (isDragging) {
        setIsDragging(false);
        scrollContainerRef.current.style.cursor = 'grab'; // Reset cursor on mouse leave
      }
    };
  
  return (
    
    <>
      {!isMobile ? 
      <div ref={scrollContainerRef} 
          className={`mb-4 homepage-testimonies-container`} onMouseDown={handleMouseDown}
          onMouseMove={handleMouseMove}
          onMouseUp={handleMouseUp}
          onMouseLeave={handleMouseLeave}>
          {testimonies.map((testimony, index) => (
            <Card
              key={index}
              className="homepage-testimonies row m-auto"
              cardBodyClass="row m-auto"
            >
              <div className="col-12 col-md-7 p-3">
                <div className="homepage-testimonies-content d-flex flex-row align-items-center">
                  <Avatar
                    shape="circle"
                    alt="Testimony Image"
                    src={testimony.userimage?testimony.userimage:<i className={`fa-thin fa-user bg-dark ${isTablet?'p-3':'p-4'}`} style={{width:'100%', height:'100%', fontSize:`${isTablet?'80px':'120px'}`}}></i>}
                    className="homepage-testimonies-image"
                  />
                  <span className="homepage-testimonies-name">
                    <Text fontColor="text-white" fontSize={`${isTablet?'fs-md':'fs-lg'}`} fontWeight="fw-500">
                      {testimony.name}
                    </Text>
                    <Text tag="small" fontSize="fs-md" fontColor="text-link" fontWeight="fw-400">
                      {testimony.title}
                    </Text>
                  </span>
                </div>
              </div>
              <div className="col-12 col-md-5 p-3">
                <div className="homepage-testimonies-writeup">
                  <Text fontWeight="fw-500" fontSize={`${isTablet?'fs-md':'fs-lg'}`} fontColor="text-white">
                    {truncateText({text:testimony.text,charLimit:110})}
                  </Text>
                </div>
              </div>
            </Card>
          ))}
      </div>
 : 
      <div className="p-2 mb-4">
        <Card className="homepage-testimonies row m-auto" cardBodyClass="row m-auto">
          <div className="col-12 col-md-6  p-3">
            <div className="homepage-testimonies-content d-flex flex-row align-items-center">
              <Avatar
                shape="circle"
                size={130}
                src={currentTestimony.userimage?currentTestimony.userimage:<i className={`fa-thin fa-user bg-dark ${isMobile?'p-2':'p-4'}`} style={{width:'100%', height:'100%', fontSize:`${isMobile?'40px':'120px'}`}}></i>}
                alt="Testimony Image"
                className="m-1 homepage-testimonies-image"
              />
              <span className="homepage-testimonies-name">
                <Text fontColor="text-white" fontSize="fs-md" fontWeight="fw-500">
                  {currentTestimony.name}
                </Text>
                <Text tag="small" fontSize="fs-sm" fontColor="text-link" fontWeight="fw-200">
                  {currentTestimony.title}
                </Text>
              </span>
            </div>
          </div>
          <div className="col-12 col-md-6  p-3">
            <div className="homepage-testimonies-writeup">
              <Text fontWeight="fw-300" fontSize={`${isMobile?'fs-sm':'fs-md'}`} fontColor="text-white">
                {truncateText({text:currentTestimony.text,charLimit:110})}
              </Text>
            </div>
          </div>
        </Card>

        {/* Navigation Buttons */}
        <div className="navigation-buttons d-flex justify-content-between">
          
          <i className="fa-light fa-chevron-left prev-button" onClick={prevTestimony}
            disabled={currentTestimonyIndex === 0}></i>
          <i className="fa-light fa-chevron-right next-button" onClick={nextTestimony}
            disabled={currentTestimonyIndex === testimonies.length - 1}></i>
          
        </div>
      </div>}
    </>
  );
};

// Prop Validation
HomepageTestimonies.propTypes = {
  isMobile: PropTypes.bool.isRequired,
};

export default HomepageTestimonies;
